import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Cart = () => {

  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('https://fakestoreapi.com/products')
    .then(response => {
      console.log(response.data);
    })
    .then(response => {
      response.json()
    })
    .then(data => {
      setData(data)
    })
    .catch(error => {
      console.log(error);
    });
  }, []);

  return (
    <h1>{getProduct}</h1>
  );
}

export default Cart;
